import React from 'react';
import './common.scss';

function App() {
  return (
    <div className="App">
      <div className="main-scene">
        <section className="flight">
          <p className="full"><span className="slash-end">Ref no.</span>QFGYPS</p>
          <p className="full"><span className="slash-end">Ref no.</span>QFGYPS</p>
          <div className="flight-info">
          <h1>上機</h1>  
          <div clasName="flight-info--detail">
            <div className="row">
              <p></p>
            </div>
          </div>
          </div>
          <div className="flight-info">
          <h1>落機</h1>
          </div>
        </section>
      </div>
    </div>
  );
}

export default App;
